    }]
}
const cityOptions = [
    {
      key: 'Bangalore',
      text: 'Bangalore',
      value: 1,
    },
  ]
  
  
  handleChange = (e)=>{
    this.setState({
        lat : this.state.co[value].la,
        long : this.state.co[value].lo
    })
 }


  const DropdownExampleSelection = () => (
    <Form>
        <Form.Field>
            <h1>City</h1>
    <Dropdown
      placeholder='Select Friend'
      fluid
      selection
      onChange={this.handleChange}
      options={cityOptions}
    />
    </Form.Field>
    </Form>
  )
  
